import React, { Component } from 'react';


class Card extends Component{

  render(){
    return(
      <div className="boxes">
        <a className="box" href="">
          <img className="box_thumbnail" src =''></img>

            <div className="box_left">
              <img className="box_left-icon"src='' ></img>
            </div>
            <div className="box_right">
              <div className="box_right-title">タイトル</div>
              <div className="box_right-username">名前</div>
              <div className="box_right-view">支援 0 回/公開日</div>

         </div>
        </a>  
      </div>
    );
  }
}

export default Card;
